class EmojiUnicode{constructor(){throw new Error("Can not instantiate. Please use the static members.")}static raw(a){if(1===a.length)return[a.charCodeAt(0)];if(1<a.length){const b=[];for(let c=0;c<a.length;c++){const d=a.charCodeAt(c);if(55296<=d&&56319>=d){const e=a.charCodeAt(c+1);56320<=e&&57343>=e&&b.push(1024*(d-55296)+(e-56320)+65536)}else(55296>d||57343<d)&&b.push(d)}return b}return[]}static hex(a,b=" ",c=""){return EmojiUnicode.raw(a).map(a=>`${c}${a.toString(16)}`).join(b)}}export default EmojiUnicode;